import React from "react";
import '../'

const skillList = ['HTML', 'CSS', 'JavaScript', 'Bootstrap', 'Node.js', 'React.js', "REST API's", "MVC FileStructure" ]

function Skills() {
    return (
        <>
            <h3 class="titleCard">My Skills</h3>
            <p>Here are the skills I've learned in my Bootcamp so far:</p>
            <ul>
                {skillList.map((skill) => {
                    return (
                        <li>{skill}</li>
                    )
                })}
            </ul>
        </>
    )
}

export default Skills
